class Navbar extends Component {
    render() {
        return (

            <header>
                <div>
                    <h1><a href="./"><img src="/images/logo.png" alt="logo"/></a></h1>
                    <div>
                        <input type="text"/>
                        <button><img src="/images/search.png" alt=""/></button>
                    </div>
                </div>
            </header>
        );
    }
}

export default Navbar;
